hudson.tasks.Shell.command:
#!/bin/bash
aws sts assume-role --duration-seconds 1800 --role-arn arn:aws:iam::600168050588:role/nih-nhlbi-TopMed-EC2Access-S3 --role-session-name "s3-test" > assume-role-output.txt export AWS_ACCESS_KEY_ID=`grep AccessKeyId assume-role-output.txt | cut -d ':' -f 2 | sed "s/[ ,\"]//g"` export AWS_SECRET_ACCESS_KEY=`grep SecretAccessKey assume-role-output.txt | cut -d ':' -f 2 | sed "s/[ ,\"]//g"` export AWS_SESSION_TOKEN=`grep SessionToken assume-role-output.txt | cut -d ':' -f 2 | sed "s/[ ,\"]//g"`
aws s3 cp s3://nih-nhlbi-topmed-released-phs001062-c1/MGH_AF_phs001062_TOPMed_WGS_freeze.9b.chr21.hg38.c1.vcf.gz .
